    "04d":"CLOUDY",
    "04n":"CLOUDY",
    "09d":"RAIN",
    "09n":"RAIN",
    "010d":"RAIN",
    "010n":"RAIN",
    "011d":"RAIN",
        "011n":"RAIN",
    "013d":"SNOW",
